  in 1988 (Harrill and others, 1988; Buto, 2009). This dataset does not contain the
  HA boundaries or geologic details included in the source dataset. For that information,
  please see the metadata for the source dataset at http://water.usgs.gov/GIS/metadata/usgswrd/XML/sir2010_5193_ha1000.xml
